import React, { useState } from 'react';
import { DndContext, closestCenter, useDroppable } from '@dnd-kit/core';
import { SortableContext, verticalListSortingStrategy, useSortable } from '@dnd-kit/sortable';
import { CSS } from '@dnd-kit/utilities';
import SortableVendorField from './SortableVendorField';

// Draggable Section Wrapper Component for Section 3
function DraggableSectionWrapper({ children, id, sectionNumber, isSectionHandleDragging = false, showDragHandle = true }) {
  const {
    attributes,
    listeners,
    setNodeRef,
    transform,
    transition,
    isDragging
  } = useSortable({ 
    id, 
    data: {
      type: 'section',
      sectionNumber: sectionNumber
    }
  });

  const style = {
    transform: CSS.Transform.toString(transform),
    transition,
    opacity: isDragging ? 0.6 : 1,
    zIndex: isDragging ? 1000 : 1,
    cursor: isDragging ? 'grabbing' : 'grab',
    position: 'relative',
    width: '100%',
    height: '100%',
    border: isDragging ? '3px solid #ff6b6b' : '2px solid #ddd',
    borderRadius: '8px',
    backgroundColor: isDragging ? 'rgba(255, 107, 107, 0.1)' : 'transparent'
  };

  return (
    <div 
      ref={setNodeRef} 
      style={style} 
      className={`sortable-section section-3 ${isDragging ? 'dragging' : ''}`}
      data-section={sectionNumber}
      data-testid={`draggable-section-${id}`}
      data-dragging={isDragging}
      {...attributes} 
      {...listeners}
    >
      <div 
        className="section-content"
        style={{ position: 'relative', width: '100%', height: '100%' }}
      >
        {children}
      </div>
    </div>
  );
}

function Section3Vendor({ 
  vendorFields, 
  sensors, 
  onVendorDragEnd,
  onAddVendorField,
  onRemoveVendorField,
  onLabelChange,
  onContentChange,
  lastModified
}) {
  const [isPaletteOver, setIsPaletteOver] = useState(false);

  // Make the section droppable for palette fields
  const { isOver, setNodeRef } = useDroppable({
    id: 'section3',
    data: {
      type: 'section',
      sectionNumber: 3,
      accepts: 'palette-fields'
    }
  });

  // Update palette over state
  React.useEffect(() => {
    setIsPaletteOver(isOver);
  }, [isOver]);

  // Handler for adding new vendor fields
  const handleAddField = () => {
    const newField = {
      id: `vendor-field-${Date.now()}-${Math.random().toString(36).substr(2, 9)}`,
      label: 'New Field:',
      placeholder: 'Enter field value'
    };
    onAddVendorField(newField);
  };

  // Log field changes to console for tracking
  React.useEffect(() => {
    if (vendorFields.length > 0) {
      console.log('ðŸ”„ Vendor Fields Updated:', {
        totalFields: vendorFields.length,
        lastModified: new Date(lastModified).toLocaleString(),
        fields: vendorFields.map((field, index) => ({
          position: index + 1,
          id: field.id,
          label: field.label,
          placeholder: field.placeholder
        }))
      });
    }
  }, [vendorFields, lastModified]);

  return (
    <div 
      ref={setNodeRef}
      className={`section-3 ${isPaletteOver ? 'palette-over' : ''}`}
      data-palette-over={isPaletteOver}
    >
      {/* Section Header */}
      <div className="section-header">
        Section 3 - VENDOR
        <span 
          className="drag-indicator"
          {...listeners}
          {...attributes}
          style={{ cursor: 'grab' }}
          title="Drag to reorder sections"
        >
          ::
        </span>
      </div>

      {/* Vendor Fields with Drag and Drop */}
      <DndContext 
        sensors={sensors}
        collisionDetection={closestCenter}
        onDragEnd={onVendorDragEnd}
      >
        <SortableContext 
          items={vendorFields.map(field => field.id)}
          strategy={verticalListSortingStrategy}
        >
          <div className="vendor-fields-container">
            {vendorFields.map(field => (
              <SortableVendorField 
                key={field.id} 
                field={field} 
                onRemove={onRemoveVendorField}
                onLabelChange={onLabelChange}
                onContentChange={onContentChange}
                section="vendor"
              />
            ))}
          </div>
        </SortableContext>
      </DndContext>

      {/* Add Field Button */}
      <div className="add-field-section">
        <button 
          className="add-field-btn" 
          onClick={handleAddField}
          title="Add new vendor field"
        >
          +
        </button>
      </div>

      {/* Drop indicator when palette field is over */}
      {isPaletteOver && (
        <div className="drop-indicator">
          <div className="drop-message">
            âœ¨ Drop field here
          </div>
        </div>
      )}
    </div>
  );
}

export default Section3Vendor;
